(13,'Hike to Naini Peak','hike-to-naini-peak','<p><span style=\"color: #1f1f1f; font-family: \'Google Sans\', Arial, sans-serif; font-size: 20px; background-color: #ffffff;\">Naina Peak trek is a diverse journey through lush forests and open paths. Beginning from starting point, the&nbsp;</span><span style=\"border-radius: 4px; padding: 0px 2px; background-color: #d3e3fd; color: #040c28; font-family: \'Google Sans\', Arial, sans-serif; font-size: 20px;\">6 km ascent offers a mix of steady and steeper sections, leading to the highest point in Nainital</span><span style=\"color: #1f1f1f; font-family: \'Google Sans\', Arial, sans-serif; font-size: 20px; background-color: #ffffff;\">. The trail provides panoramic views of the Himalayas, Nainital town, and surrounding lakes.</span></p>',436,NULL,11,NULL,NULL,NULL,8,1,'436,283,','https://youtu.be/cmrbV_6PGPs?si=lUZE3kf1jM3311WX','[{\"title\":\"Will food be provided?\",\"content\":\"Yes, snacks will be provided once we reach the summit. Water bottles will be distributed before the trek at the meeting point?\"},{\"title\":\"Can I bring my pet?\",\"content\":\"Yes, pets are allowed but at your own risk and responsibility\"}]',NULL,4,'7.00 a.m',500.00,300.00,NULL,1,NULL,NULL,NULL,'publish',0,8,8,NULL,'2025-03-04 09:47:30','2025-03-04 09:50:58',1,NULL,NULL,NULL,'hour',1);
