(17,'Bhimtal','<p><span style=\"color: #474747; font-family: Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Bhimtal is a town and a nagar panchayat, near Nainital city in Nainital district in the state of Uttarakhand, India. It is situated at an altitude of 1370 meters above sea level and is about 22 kilometers from Nainital. The major attraction in Bhimtal is the Bhimtal Lake, which has an island at its centre.</span></p>','bhimtal',303,NULL,NULL,8,'publish',33,34,NULL,8,8,NULL,NULL,NULL,'2024-11-29 14:59:39','2024-11-29 15:07:45',NULL,'[{\"image_id\":\"304\",\"title\":\"Kayaking in Bhimtal\",\"link\":\"#\",\"content\":\"Start the kayaking experience around the Bhimtal Lake, past the Island in the middle, and enjoy the beautiful view of the Bhimtal.\"}]',NULL),
(18,'Naukuchiatal','<p><span style=\"color: #474747; font-family: Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Naukuchiatal or \"lake of nine corners\" is a small hill station, near Nainital Town in Nainital district of Kumaon, Uttarakhand, India. The chairman is Devendra Singh chanotiya. The lake is 175 feet deep and is situated at 1,220 metres above sea level. It is covered in trees and shrubs.</span></p>','naukuchiatal',NULL,NULL,NULL,8,'publish',35,36,NULL,8,NULL,NULL,NULL,NULL,'2024-11-29 15:00:39','2024-11-29 15:00:39',NULL,NULL,NULL),
(19,'Pangot','<p><span style=\"color: #474747; font-family: Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Pangot is a village in the Kosiyakutoli tehsil of Nainital district in Uttarakhand, India, and a tourist destination at a height of 6,510 feet.</span></p>','pangot',305,NULL,NULL,8,'publish',37,38,NULL,8,8,NULL,NULL,NULL,'2024-11-29 15:28:39','2024-11-29 15:35:52',287,NULL,NULL),
(20,'Almora','<p><span style=\"font-weight: bold; color: #767676; font-family: Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Almora</span><span style=\"color: #474747; font-family: Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;was the seat of Chand kings that ruled over the Kumaon Kingdom. It is considered the cultural heart of the Kumaon region of Uttarakhand.</span></p>','almora',NULL,NULL,NULL,8,'publish',39,40,NULL,8,8,NULL,NULL,NULL,'2025-03-03 10:20:52','2025-03-03 10:23:59',288,'[{\"image_id\":null,\"title\":null,\"link\":null,\"content\":null}]',NULL);
