(13,'Entire villa in Nainital, India','entire-villa-in-nainital-india','<p><span style=\"color: #222222; font-family: \'Airbnb Cereal VF\', Circular, -apple-system, BlinkMacSystemFont, Roboto, \'Helvetica Neue\', sans-serif; font-size: 16px; background-color: #ffffff;\">Retreat to a quiet corner of Nainital district,into the arms ofNaukuchiatal, which has the deepest lake of the region and very laid back and peaceful. No jostling crowds, no Mall road, no Traffic jams. Near enough to all usual attractions of boating, zorbing, canoeing, Paragliding, dirt racing, ziplining, horseriding and far enough to be pin drop silent after sundown. Go trekking in forests, fishing, witness village life right next door or just LAZE! Nearby we have another villa -TheSugandhim !</span></p>',277,277,11,'Thapaliya Mehragaon, Naukuchiatal','29.32694837489773','79.59553889605391',8,NULL,'280,279,278,',NULL,'[{\"title\":\"What is the check in and checkout timings?\",\"content\":\"Check-in after 12:00\\u202fpm and Checkout before 10:00\\u202fam\"},{\"title\":\"Cancellation policy?\",\"content\":\"This reservation is non-refundable.\\r\\nReview this Host\\u2019s full policy for details.\"}]',3299.00,NULL,NULL,0,0,8,NULL,2,2,NULL,NULL,NULL,NULL,'publish',1,10,6,NULL,'2024-11-13 10:16:16','2024-12-06 12:16:37',NULL,NULL,NULL,NULL,NULL,10,NULL,NULL),
